    public struct PlayerActions
    {
        private @MainPlayerInput m_Wrapper;
        public PlayerActions(@MainPlayerInput wrapper) { m_Wrapper = wrapper; }
        public InputAction @Move => m_Wrapper.m_Player_Move;
