            @Aiming.started -= instance.OnAiming;
            @Aiming.performed -= instance.OnAiming;
            @Aiming.canceled -= instance.OnAiming;
            @WeaponSlider.started -= instance.OnWeaponSlider;
            @WeaponSlider.performed -= instance.OnWeaponSlider;
            @WeaponSlider.canceled -= instance.OnWeaponSlider;
            @WeaponNumSelector.started -= instance.OnWeaponNumSelector;
            @WeaponNumSelector.performed -= instance.OnWeaponNumSelector;
            @WeaponNumSelector.canceled -= instance.OnWeaponNumSelector;
        }

        public void RemoveCallbacks(IPlayerActions instance)
        {
            if (m_Wrapper.m_PlayerActionsCallbackInterfaces.Remove(instance))
                UnregisterCallbacks(instance);
        }

        public void SetCallbacks(IPlayerActions instance)
        {
            foreach (var item in m_Wrapper.m_PlayerActionsCallbackInterfaces)
                UnregisterCallbacks(item);
            m_Wrapper.m_PlayerActionsCallbackInterfaces.Clear();
            AddCallbacks(instance);
        }
